import Head from 'next/head'
import MainLAyout from '../components/Mainlayout'

export default function Clients() {
  return (
    <MainLAyout>
      <Head>
        
      </Head>

    <main >
        <div className="homeContainer">
        <h3 className="rowTop">Delivery</h3>
        <div className="deliveryContainer">
            <div className="delTop">
            <a type="button" className="btn btn-top btn-primary">
            <i className="fas fa-plus"></i>
                Primary
                </a>
            </div>
            <div className="table-responsive  rowTop">
                <table className="table ">
                    <thead>
                        <tr>
                        <th>Id</th>
                        <th>Firstname</th>
                        <th>Lastname</th>
                        <th>Username</th>
                        <th>Рассылка</th>
                        <th>Первое обращение</th>
                        <th>Последнее обращение</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                        <td></td>
                    
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
        </div>
    </main>

      

      <style jsx>{`
       
    .rowTop{
        margin-top:20px;
        
    }
    .fas{
        font-family:FontAwesome;
        -webkit-font-smoothing: antialiased;
        display: inline-block;
        font-style: normal;
        font-variant: normal;
        text-rendering: auto;
        line-height: 1;
        font-weight: 900;
        margin: 5px 10px;
    }
    tr{
        border-bottom:2px solid #dee2e6;
    }
    td ,th{
        border-top:none;
        border-left:2px solid white;
        border-bottom:2px solid #dee2e6;
        width:15%;
    }
    .deliveryContainer{
        padding-top:15px;
        background-color:red;
        display :block;
        margin-right: auto;
        margin-left: auto;
        padding-left: 15px;
        padding-right: 15px;
        box-sizing: border-box;
    }
    .delTop{
    padding: 15px;
    margin-bottom: 20px;
    border-radius: 0;
    background-color: #FFF;
    box-shadow: 0 2px 2px 0 rgba(0, 0, 0, 0.16), 0 0px 2px 0 rgba(0, 0, 0, 0.12);
    }
    .btn-top{
        height: 36px;
        padding: 0 26px;
        margin: 6px 0;
        position: relative;
        color: #FFF;
        font-weight: 500;
        text-transform: uppercase;
        text-align:center;
        font-size: 14px;
      
    }
    .btn-top:hover{}
      `}</style>
    </MainLAyout>
  )
}
